export const ChevronDownIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ChevronDownIcon">
    <path d="m10.666 2.5.834.962L5.941 9.5l-.017-.019-.017.019L.5 3.448l.847-.948 4.589 5.136 4.73-5.136z" />
  </svg>,
  "ChevronDown",
  "chevron down"
);
